import React, { Component } from 'react'

const API = "http://localhost:5000/questions/showAll"

class Landing extends Component {

  constructor(props) {
    super(props);
    this.state = {
        hits:[],
    };
}


componentDidMount(){
  fetch(API)
  .then(response => response.json())
  .then(data => this.setState({hits:data}))
}
  render() {
    return (
      <div>
        <h3>Questions</h3>
        <ul>
          {
            this.state.hits.map(hit =>
                <li>{hit.questionTitle}</li>
              )
          }
        </ul>
      </div>
    );
  }
}

export default Landing;
